import { Login } from "../Layout/LoginLayout"
import { DefaultLayout } from "../Layout/DefaultLayout"
const publicRoutes = [
  { path: '/', component: Login },
  { path: '/home', component: DefaultLayout
 },
 
]
const privateRoutes = []
export { publicRoutes, privateRoutes }
